import React, { FC } from 'react';

interface HeadingProps {
  heading: string;
  subheading: string;
}

const Heading: FC<HeadingProps> = ({ heading, subheading }) => {
  return (
    <>
      <h1 className="flex flex-start text-white font-sans pl-20px text-6xl">{heading}</h1>
      <h3 className="flex flex-start text-light-grey font-normal leading-6 pl-20px mt-20px text-3xl display-linebreak">{subheading}</h3>
    </>
  );
};

export default Heading;
